import React, { useState } from 'react';
import './App.css';
// import FooterComponent from './components/FooterComponent';
// import HeaderComponent from './components/HeaderComponents';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Authentication from './components/Authentication'; // Updated import

import Settings from './components/Settings';
import EditProfile from './components/EditProfile';
import LoginAndSecurity from './components/LoginAndSecurity';
import ForgotPassword from './components/ForgotPassword';
import Dashboard from './components/Dashboard';
import DisposeMenu from './components/DisposeMenu';
import DisposeForm from './components/DisposeForm';
import TrackOrder from './components/TrackOrder';
import Profile from './components/Profile';
import ProtectedRoute from './components/ProtectedRoute';

function App() {
  const [user, setUser] = useState({
    name: 'Manyatha',
    profilePicture: 'https://via.placeholder.com/150'
  });

  const handleLoginSuccess = (userData) => {
    setUser(userData);
  };

  return (
    <div className="bg-gray-900 text-white">
      <Router>
        {/* <HeaderComponent /> */}
        <div className="container">
          <Routes>
            <Route 
              exact 
              path="/" 
              element={<Authentication onLoginSuccess={handleLoginSuccess} />} 
            />



            <Route 
              path="/customers" 
              element={<Authentication onLoginSuccess={handleLoginSuccess} />} 
            />
            <Route 
              path="/forgot-password" 
              element={<ForgotPassword />} 
            />
            <Route 
              path="/dashboard" 
              element={
                <ProtectedRoute user={user}>
                  <Dashboard user={user} />
                </ProtectedRoute>
              } 
            />
            <Route 
              path="/dispose" 
              element={
                <ProtectedRoute user={user}>
                  <DisposeMenu />
                </ProtectedRoute>
              } 
            />
            <Route 
              path="/dispose/:itemType" 
              element={
                <ProtectedRoute user={user}>
                  <DisposeForm />
                </ProtectedRoute>
              } 
            />
            <Route 
              path="/track-order" 
              element={
                <ProtectedRoute user={user}>
                  <TrackOrder />
                </ProtectedRoute>
              } 
            />
            <Route 
              path="/profile" 
              element={
                <ProtectedRoute user={user}>
                  <Profile profilePicture={user.profilePicture} name={user.name} />
                </ProtectedRoute>
              } 
            />
            <Route 
              path="/rewards" 
              element={
                <ProtectedRoute user={user}>
                  <div>Rewards Page</div>
                </ProtectedRoute>
              } 
            />
            <Route 
              path="/customer-support" 
              element={
                <ProtectedRoute user={user}>
                  <div>Customer Support Page</div>
                </ProtectedRoute>
              } 
            />
            <Route 
              path="/about-us" 
              element={
                <ProtectedRoute user={user}>
                  <div>About Us/Support Us Page</div>
                </ProtectedRoute>
              } 
            />
          </Routes>
        </div>
        {/* <FooterComponent /> */}
      </Router>
    </div>
  );
}

export default App;
